import {useState, useEffect} from "react";
import { useZohoContext } from "../Context/ZohoContext";
import SearchStores from "./SearchStores";

const OpenWidget= (props) => {

    const{id}=useZohoContext();
    const{stores}=useZohoContext();
    
    useEffect(() => {
        console.log(id)
        
    }, [id])


    const getStores = ()=>{
        props.setLink("searchStores")

    }
    const getBrand = ()=>{
        console.log(id)
    }

    return ( 
        <div className="text-center">
            <button onClick={getStores} className="btn btn-primary">
                Stores
            </button>
            <button onClick={getBrand} className="btn btn-primary">
                Brands
            </button>
            <table class="table">
                <thead>
                    <tr>
                    <th scope="col">First</th>
                    <th scope="col">Last</th>
                    <th scope="col">Handle</th>
                    </tr>
                </thead>
                <tbody>
                    <tr>
                    <td>Mark</td>
                   
                    </tr>
                    <tr>
                    <td>Jacob</td>
                    
                    </tr>
                    <tr>
                    <td colspan="2">Larry the Bird</td>
                   
                    </tr>
                </tbody>
                </table>
        </div>
        
     );

}
 
export default OpenWidget
;
